const PostExcerpt = ( {post}) => {
    return (
        // <article key={post.id}>
        <article>
            {post.id}
            {post.title? <h3>{post.title}</h3> : <h3>ni ma tytulu</h3>}
            {post.body? <p>{post.body.substring(0,100)}</p> : <h3>ni ma cia≈Ça postu</h3>}
            
            
            <p>{post.createdAt}</p>
            {post.date? (<p>{post.date} data</p>) : <p>some time ago</p>}
            <p>{post.createdAt}</p>
            {post.author? (<p>{post.author}</p>): <p>unknown to mankind</p>}
                    
        </article>
    )
}

export default PostExcerpt
